window.bookSummaryJSON = "<p><b>All life on Earth has been stolen away by The System.</b></p> <p>It was transported to another world at the behest of a distant galactic empire that lives in terror of humanity's potential.</p> <p>Ben - just a normal, if not <i>slightly</i> above average guy -&nbsp; had been about to go on the first real vacation of his adult life. But plans changed. Now, he must contend with danger and mystery in a world full of monsters, magic, and treasure. Armed with nothing but his wits and a special item given to him by The System, he embarks on a damn good adventure.</p> <p><i>Written by Matthew Howry, better known to Royal Road fans as Salty Waters.</i></p>"; 
